import React from "react";
import "antd/dist/antd.css";
import { Checkbox } from "antd";
import { FiltersOptions } from "./Filters.enum";

import "./Filters.scss";

const { active, promo } = FiltersOptions;

function onChange(e: any) {
  console.log(e.target.name);
}

export const Filters = ({ setFilters }) => {
  return (
    <div className="filters">
      <Checkbox onChange={onChange} name={active}>
        {active}
      </Checkbox>
      <Checkbox onChange={onChange} name={promo}>
        {promo}
      </Checkbox>
    </div>
  );
};
